import { Button } from "@mui/material";

const MyButton = (props) => {
  const { value, type, onClick } = props;
  const buttonType = type === "positive" ? "true" : "false";

  return (
    <Button
      value={value}
      bgcolor={buttonType ? "#37b3a8" : "#f5f5f5"}
      color={buttonType ? "white" : "black"}
      onClick={onClick}
    ></Button>
  );
};

export default MyButton;
